import React, { Component } from "react";

class App extends Component {
  render() {
    return (
        <div>
        <Form>
  <Form.Row>
    <Col>
      <Form.Control placeholder="First name" />
    </Col>
    <Col>
      <Form.Control placeholder="Last name" />
    </Col>
  </Form.Row>
</Form>;
        </div>
    );
  }
}

export default App;
